INSERT INTO `app_status` (`id`, `title`, `description`, `notification_template`, `sort`, `send_check`) VALUES
(1, 'Выезд из Турции', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Машина с Вашим грузом выехала из Турции:&nbsp;[APP_STATUS_DATE]</p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><u>Логин - Ваш email</u></strong></p>\r\n\r\n<p><u><strong>Пароль - 12345qwE</strong></u></p>\r\n\r\n<p><span style="color:#0000CD"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 1, 0),
(2, 'В дороге', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Ваш груз в дороге:&nbsp;[APP_STATUS_DATE]</p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><u>Логин - Ваш email</u></strong></p>\r\n\r\n<p><u><strong>Пароль - 12345qwE</strong></u></p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 2, 0),
(3, 'На складе в Москве', '', '<p>Здравствуйте!&nbsp;</p>\r\n\r\n<p>Машина с Вашим грузом приехала на склад TEDTRANS | Босфор Логистика&nbsp;[APP_STATUS_DATE]</p>\r\n\r\n<p><strong><u>Внимание!!! Для оплаты на расчетный счет необходимо соглосовать реквизиты у бухгалтерии по номеру 8(901)759-65-30!</u></strong></p>\r\n\r\n<p><strong><u>Реквизиты на проверку надо отправить на почту zg@tedtrans.com - Галина.</u></strong></p>\r\n\r\n<p><strong><u>Без согласования реквизитов плательщика и подписанного договора платежи не принимаются и могут быть возвращены обратно!</u></strong></p>\r\n\r\n<p>Адрес: Москва, Проектируемый проезд 134. Логистический центр &quot;Славянский мир&quot;&nbsp;корпус 10, склад 6.&nbsp;&nbsp;<span style="color:rgb(0, 0, 0)">Тел.: 8915</span><span style="color:rgb(0, 0, 0)">2091111. Хизри</span></p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Во вложении счет на оплату&nbsp;</p>\r\n\r\n<p>ГТД [APP_GTD]</p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></strong></p>\r\n', 5, 1),
(5, 'Оплачен', '', '<p>Спасибо за оплату.</p>\r\n\r\n<p>[APP_LIST]</p>\r\n', 4, 0),
(6, 'Отправление из Китая', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Ваш груз отправлен из Китая&nbsp;[APP_STATUS_DATE]</p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><u>Логин - Ваш email</u></strong></p>\r\n\r\n<p><u><strong>Пароль - 12345qwE</strong></u></p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 2, 0),
(7, 'Таможенное оформление ', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Машина с Вашим грузом&nbsp;прошла&nbsp;таможенное оформление и едет в сторону склада в Москве.</p>\r\n\r\n<p>По прибытии машины в Москву Вам придет еще одно уведомление.&nbsp;</p>\r\n\r\n<p><strong><u>Внимание!!! Для оплаты на расчетный счет необходимо соглосовать реквизиты у бухгалтерии по номеру 8(901)759-65-30!</u></strong></p>\r\n\r\n<p><strong><u>Реквизиты на проверку надо отправить на почту zg@tedtrans.com - Галина.</u></strong></p>\r\n\r\n<p><strong><u>Без согласования реквизитов плательщика и подписанного договора платежи не принимаются и могут быть возвращены обратно!</u></strong></p>\r\n\r\n<p>Адрес: Москва, Проектируемый проезд 134. Логистический центр &quot;Славянский мир&quot;, корпус 10, склад 6. (Рядом с ТК КИТ).&nbsp;<span style="color:rgb(0, 0, 0)">Тел.:&nbsp;</span><span style="color:rgb(0, 0, 0)"><a href="tel:89152091111" style="box-sizing: border-box; background-color: transparent; color: rgb(51, 122, 183); text-decoration-line: none;">89152091111</a></span><span style="color:rgb(0, 0, 0)">. Хизри&nbsp;</span></p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>ГТД&nbsp;[APP_GTD]&nbsp;</p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><span style="color:#000080"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 3, 1),
(8, 'На стадии отгрузки из Китая', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Ваш груз на стадии отгрузки</p>\r\n\r\n<p>[APP_LIST]</p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><u>Логин - Ваш email</u></strong></p>\r\n\r\n<p><u><strong>Пароль - 12345qwE</strong></u></p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 0, 0),
(9, 'Доставлен ', '', '<p>Здравствуйте!&nbsp;</p>\r\n\r\n<p>Ваш груз доставлен.</p>\r\n\r\n<p><strong>[APP_LIST]&nbsp;</strong></p>\r\n\r\n<p>Во вложении счет на оплату&nbsp;</p>\r\n\r\n<p>ГТД [APP_GTD]</p>\r\n\r\n<p><strong><span style="color:#0000CD"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></strong></p>\r\n', 0, 1),
(10, 'Оформление в Турции ', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Машина с Вашим грузом оформляется в Турции для экспорта:</p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 0, 0),
(11, 'Выезд из Вильнюса', '', '<p>Здравствуйте!</p>\r\n\r\n<p>Машина с Вашим грузом выехала из Вильнюса:&nbsp;[APP_STATUS_DATE]</p>\r\n\r\n<p><strong>[APP_LIST]</strong></p>\r\n\r\n<p>Для подробной информации зайдите в личный кабинет по ссылке&nbsp;http://crm.tedtrans.com/</p>\r\n\r\n<p><strong><u>Логин - Ваш email</u></strong></p>\r\n\r\n<p><u><strong>Пароль - 12345qwE</strong></u></p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><em>С уважением TEDTRANS | Босфор Логистика.</em></span></p>\r\n', 0, 0),
